import React from 'react'
import classes from './ViewMode.module.css'

export default function ViewMode() {
   let isToggled = false ? true : false;
   let style = {};
        if(isToggled) {
            style = {backgroundColor: "#f56157"};
        }


return (
    <div className={classes.ViewModeContainer}>
        <div onClick={() => isToggled = true} style={style} className={classes.ViewModeItem}>Day</div>
        <div className={classes.ViewModeItem}>Week</div>
        <div className={classes.ViewModeItem}v>Month</div>
    </div>
)
}
